import React from 'react';
import axios from 'axios';

class Unexpanded extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            numberOfKills: null
        };
    }
    render() {
        return (
            <div>
                <p className='noPad'>{this.props.name}</p>
                <p>{this.state.numberOfKills}</p>
            </div>
        )
    }
    componentDidMount = () => {
        axios.get('/api/esi/Tuesday')
            .then(response => {
                return this.setState({numberOfKills: response.data.parsedData})
            })
    };
};

export default Unexpanded;
